using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Web;
using System.Web.UI;
using System.Web.UI.WebControls;

namespace VinoSOFT_TFI
{
    public partial class AdminProductosEdicion : System.Web.UI.Page
    {
        BLL.BLL_Producto gestorProducto = new BLL.BLL_Producto();
        BLL.BLL_Categoria gestorCategoria = new BLL.BLL_Categoria();
        string imagenDefault = "";

        AdminACL gestorPermisos = new AdminACL();
        protected void Page_Load(object sender, EventArgs e)
        {
            if (!IsPostBack)
            {
                if (gestorPermisos.EstaLogueado())
                {
                    CargarDropdownCategoria();
                    CargarInfo();
                    ActualizarBarraNavegacionLogin();
                }
                else
                {
                    Response.Redirect("AdminLogin.aspx", false);
                    Context.ApplicationInstance.CompleteRequest();
                }
            }
        }

        private void CargarDropdownCategoria()
        {
            List<BE.BE_Categoria> lista = new List<BE.BE_Categoria>();
            lista = gestorCategoria.Listar(null);

            ddCategoria.DataSource = null;
            ddCategoria.DataTextField = "Nombre";
            ddCategoria.DataValueField = "id";
            ddCategoria.DataSource = lista;
            ddCategoria.DataBind();
        }

        private void CargarInfo()
        {
            try
            {
                iptDescripcion.Attributes["MaxLength"] = "300";
                iptDescripcionCorta.Attributes["MaxLength"] = "150";
            }
            catch
            {

            }

            if(Request.QueryString["id"] != null)
            {
                if(int.TryParse(Request.QueryString["id"], out _))
                {
                    int id = int.Parse(Request.QueryString["id"]);
                    BE.BE_Producto producto = new BE.BE_Producto();
                    producto = gestorProducto.listarProductoPorID(id);

                    if (producto != null)
                    {
                        iptCodigo.Value = producto.IDPRODUCTO.ToString();
                        iptNombre.Text = producto.NOMBRE;
                        iptDescripcion.Text = producto.DESCRIPCION;
                        iptDescripcionCorta.Text = producto.DESCRIPCIONCORTA;
                        iptPrecio.Text = producto.PRECIO.ToString();
                        iptStock.Text = producto.STOCK.ToString();
                        iptStock.Enabled = true; //si se esta editando no se puede cambiar el stock porque se actualiza al vender o recibir.
                        iptStockMinimo.Text = producto.STOCKMINIMO.ToString();

                        ddActivo.SelectedValue = producto.ACTIVO.ToString();
                        ddCategoria.SelectedValue = producto.CATEGORIA.ID.ToString();

                        if (!string.IsNullOrEmpty(producto.IMAGEN)) {
                            imgFotoSubida.Visible = true;
                            imgFotoSubida.ImageUrl = "data:image/jpeg;base64," + producto.IMAGEN;
                        }

                        btnEliminar.Visible = true;
                    }

                }
                else
                {
                    return;
                }
            }
            else
            {
                imgFotoSubida.Visible = false;
                btnEliminar.Visible = false;
            }

        }

        protected void btnEliminar_Click(object sender, EventArgs e)
        {
            if(int.TryParse(iptCodigo.Value, out _))
            {
                int idProducto = int.Parse(iptCodigo.Value);
                BE.BE_Producto producto = new BE.BE_Producto();
                producto.IDPRODUCTO = idProducto;

                bool eliminado = gestorProducto.eliminarProducto(producto);
                if (eliminado)
                {
                    //Response.Redirect("AdminProductosListas.aspx",false);
                    //Context.ApplicationInstance.CompleteRequest();
                    mp1.Show();
                    mjsBodyMP.Text = "Producto eliminado con éxito.";
                }
                else
                {
                    mp1.Show();
                    mjsBodyMP.Text = "Error al eliminar el producto.";
                }
            }
        }

        protected void btnGuardar_Click(object sender, EventArgs e)
        {
            BE.BE_Producto producto = new BE.BE_Producto();
            BE.BE_Categoria categoria = new BE.BE_Categoria();

            bool guardado = false;

            producto.NOMBRE = iptNombre.Text;
            producto.DESCRIPCION = iptDescripcion.Text;
            producto.DESCRIPCIONCORTA = iptDescripcionCorta.Text;
            categoria.ID = int.Parse(ddCategoria.SelectedValue);
            producto.CATEGORIA = categoria;

            if(iptFoto.HasFile)
            {

                byte[] bytesImagen;
                using (BinaryReader br = new BinaryReader(iptFoto.PostedFile.InputStream))
                {
                    bytesImagen = br.ReadBytes(iptFoto.PostedFile.ContentLength);
                }
                string imagenB64 = Convert.ToBase64String(bytesImagen);
                producto.IMAGEN = imagenB64;

            }
            else
            {
                producto.IMAGEN = imagenDefault; 
            }
         
            producto.STOCK = int.Parse(iptStock.Text);
            producto.STOCKMINIMO = int.Parse(iptStockMinimo.Text);
            producto.PRECIO = float.Parse(iptPrecio.Text);
            producto.ACTIVO = int.Parse(ddActivo.SelectedValue);


            if (int.TryParse(iptCodigo.Value, out _))
            {
                producto.IDPRODUCTO = int.Parse(iptCodigo.Value);
                guardado = gestorProducto.actualizarProducto(producto);

                if (guardado)
                {
                    mp1.Show();
                    mjsBodyMP.Text = "Cambios Guardados con éxito";
                }
                else
                {
                    mp1.Show();
                    mjsBodyMP.Text = "Error al guardar los cambios.";
                }
            }
            else
            {
                producto.IDPRODUCTO = 0;
                guardado = gestorProducto.insertarProducto(producto);
                if (guardado)
                {
                    mp1.Show();
                    mjsBodyMP.Text = "Producto creado con éxito";
                }
                else
                {
                    mp1.Show();
                    mjsBodyMP.Text = "Error al crear el producto.";
                }
            }
        }

        public void ActualizarBarraNavegacionLogin()
        {
            BE.BE_Usuario usuario = (BE.BE_Usuario)Session["UsuarioLogueado"];

            ((Backend)Master).MenuUsuarioNoLogeado = false;
            ((Backend)Master).MenuUsuarioLogeado = true;
            ((Backend)Master).NombreUsuario = "Hola, " + usuario.NOMBRE;
            ((Backend)Master).MenuInicio = true;

            ActualizarMenuesPorPermisos();

        }

        public void ActualizarMenuesPorPermisos()
        {
            BE.BE_Usuario usuario = (BE.BE_Usuario)Session["UsuarioLogueado"];

            ((Backend)Master).MenuAdmFzas = gestorPermisos.TienePermiso("MOD_ADM_FZAS", usuario);
            ((Backend)Master).MenuSeguridad = gestorPermisos.TienePermiso("MOD_SEGURIDAD", usuario);
            ((Backend)Master).MenuVentas = gestorPermisos.TienePermiso("MOD_VENTAS", usuario);
            ((Backend)Master).MenuMkt = gestorPermisos.TienePermiso("MOD_MKT", usuario);
            //((Backend)Master).MenuAdmFzas = gestorPermisos.TienePermiso("MOD_ADM_FZAS", usuario);
            //((Backend)Master).MenuAdmFzas = gestorPermisos.TienePermiso("MOD_ADM_FZAS", usuario);
        }

        protected void BtnOk_Click(object sender, EventArgs e)
        {
            mp1.Hide();
            Server.Transfer("AdminProductosLista.aspx", false);
            Context.ApplicationInstance.CompleteRequest();
        }

    }
}